inline void samp_make::c_targdep_RemoveAll(samp_make::FTarget& target) {
    for (u32 i = 0; i < target.c_targdep_n; i++) {
        // mark all elements as not-in-array
        target.c_targdep_elems[i]->target_c_targdep_in_ary = false;
    }
    target.c_targdep_n = 0;
}

// --- samp_make.FTarget.c_targdep.qFind
// Return reference without bounds checking
inline samp_make::FTargdep& samp_make::c_targdep_qFind(samp_make::FTarget& target, u32 idx) {
    return *target.c_targdep_elems[idx];
}

// --- samp_make.FTarget.c_targdep.InAryQ
// True if row is in any ptrary instance
inline bool samp_make::target_c_targdep_InAryQ(samp_make::FTargdep& row) {
    return row.target_c_targdep_in_ary;
}

// --- samp_make.FTarget.c_targdep.qLast
// Reference to last element without bounds checking
inline samp_make::FTargdep& samp_make::c_targdep_qLast(samp_make::FTarget& target) {
    return *target.c_targdep_elems[target.c_targdep_n-1];
}

// --- samp_make.FTarget.c_targrec.InsertMaybe
// Insert row into pointer index. Return final membership status.
inline bool samp_make::c_targrec_InsertMaybe(samp_make::FTarget& target, samp_make::FTargrec& row) {
    samp_make::FTargrec* ptr = target.c_targrec;
    bool retval = (ptr == NULL) | (ptr == &row);
    if (retval) {
        target.c_targrec = &row;
    }
    return retval;
}

// --- samp_make.FTarget.c_targrec.Remove
// Remove element from index. If element is not in index, do nothing.
inline void samp_make::c_targrec_Remove(samp_make::FTarget& target, samp_make::FTargrec& row) {
    samp_make::FTargrec *ptr = target.c_targrec;
    if (LIKELY(ptr == &row)) {
        target.c_targrec = NULL;
    }
}

// --- samp_make.FTarget.c_targsrc_curs.Reset
inline void samp_make::target_c_targsrc_curs_Reset(target_c_targsrc_curs &curs, samp_make::FTarget &parent) {
    curs.elems = parent.c_targsrc_elems;
    curs.n_elems = parent.c_targsrc_n;
    curs.index = 0;
}

// --- samp_make.FTarget.c_targsrc_curs.ValidQ
// cursor points to valid item
inline bool samp_make::target_c_targsrc_curs_ValidQ(target_c_targsrc_curs &curs) {
    return curs.index < curs.n_elems;
}

// --- samp_make.FTarget.c_targsrc_curs.Next
// proceed to next item
inline void samp_make::target_c_targsrc_curs_Next(target_c_targsrc_curs &curs) {
    curs.index++;
}

// --- samp_make.FTarget.c_targsrc_curs.Access
// item access
inline samp_make::FTargsrc& samp_make::target_c_targsrc_curs_Access(target_c_targsrc_curs &curs) {
    return *curs.elems[curs.index];
}

